## 테스트용 글

조 바이든 미국 대통령은 한미일 정상 회의 목적이 "보다 평화롭고 번영하는 인도-태평양에 있다"

고 밝혔습니다.중국 문제도 다뤘지만, 초점은 세계에 이익이 될 포괄적 협력 강화에 맞췄다는 겁니다.[조 바이든/미국 대통령/현지시각 18일 : "이번 정상회의는 중국에 관한 게 아닙니다. 만남 목적이 아니었습니다. 하지만 중국 문제가 떠올랐습니다. 중국의 경제적 강압과 긴장 고조에 대한 우려를 공유하지 않았다고 할 수는 없습니다."]

여론은 파장에 주목했습니다.뉴욕 타임스는 "중국의 적개심을 강화할 수 있는 방위 합의"라는 제목으로 분석기사를 냈습니다.영국 언론 가디언은 일요판 사설을 통해 중국을 향한 바이든 대통령의 외교와 경제, 군사적 압박을 '신냉전' 말고 달리 해석할 방법이 있느냐고 반문했습니다.CNN을 비롯한 현지 방송들 역시 중국 측 반응을 소개하며 대립 상황을 잇따라 보도했습니다.[윌 리플리/CNN 선임 국제 특파원 : "북한과 러시아, 중국 같은 권위주의 진영의 협력 확대는 미국을 무척 괴롭히는 문제이며 그 반대의 경우도 마찬가지입니다."]

